// outsiders-data.jsx
import React, { useState, useEffect } from 'react';
import HostelRegistration from './outsiders';

const OutsidersData = () => {
    const [outsiders, setOutsiders] = useState([]);

    const fetchOutsiders = () => {
        fetch("http://localhost:8080/outsider/getAll")
            .then(response => response.json())
            .then(data => setOutsiders(data))
            .catch(error => console.error("Error fetching outsiders:", error));
    };

    useEffect(() => {
        fetchOutsiders();
    }, []);

    return (
        <div>
            <HostelRegistration fetchOutsiders={fetchOutsiders} />
            <h2>Outsiders Data</h2>
            <table>
                <thead>
                    <tr>
                        <th>Full Name</th>
                        <th>Age</th>
                        <th>Gender</th>
                        <th>Contact Number</th>
                        <th>Address</th>
                        <th>DOB</th>
                        <th>Guardian Name</th>
                        <th>Guardian Contact</th>
                        <th>Purpose of Stay</th>
                        <th>Physical Limitations</th>
                    </tr>
                </thead>
                <tbody>
                    {outsiders.map((outsider, index) => (
                        <tr key={index}>
                            <td>{outsider.fullName}</td>
                            <td>{outsider.age}</td>
                            <td>{outsider.gender}</td>
                            <td>{outsider.contactNumber}</td>
                            <td>{outsider.address}</td>
                            <td>{outsider.dob}</td>
                            <td>{outsider.guardianName}</td>
                            <td>{outsider.guardianContact}</td>
                            <td>{outsider.purposeOfStay}</td>
                            <td>{outsider.physicalLimitations}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default OutsidersData;
